import i18n from "i18next";
import { initReactI18next } from "react-i18next";

import French from "../src/translations/french.json";
import English from "../src/translations/english.json";
import Spanish from "../src/translations/spanish.json";
import Portuguese from "../src/translations/portuguese.json";

const resources = {
  en: {
    translation: English,
  },
  ptBr: {
    translation: Portuguese,
  },
  es: {
    translation: Spanish,
  },
  fr: {
    translation: French,
  },
};

i18n.use(initReactI18next).init({
  resources,
  lng: "ptBr",
});

export default i18n;
